import React from "react";
import "./Footer.css";

export default function Footer() {
  return (
    <footer className="Footer">
      Created by
      <a
        href="https://github.com/molinarijess"
        className="my-name"
        target="_blank"
      >
        Jessica Molinari
      </a>
    </footer>
  );
}
